import React from 'react'
import User from './User';

function Users() {
    const users = [
        {id:1,name:"akash"},
        {id:1,name:"koushik"},
        {id:1,name:"radika"}
    ];
  return (
    <div>
        {users.map((user)=>{
            <h1>{user.id}</h1>
        })}
    </div>
  )
}

export default Users
